import React, { useState } from 'react';
import { Calendar, FileText, Download, CheckCircle, Loader } from 'lucide-react';

const Export = () => {
  const [dateRange, setDateRange] = useState('last7days');
  const [fileFormat, setFileFormat] = useState('csv');
  const [exports, setExports] = useState([
    {
      id: 1,
      name: 'Analytics_Export_2023-10-27.csv',
      progress: 100,
      status: 'complete'
    },
    {
      id: 2,
      name: 'User_Data_Export_2023-10-26.pdf',
      progress: 60,
      status: 'progress'
    }
  ]);

  const handleExport = (format) => {
    const timestamp = new Date().toISOString().split('T')[0];
    const newExport = {
      id: exports.length + 1,
      name: `Export_${timestamp}.${format}`,
      progress: 0,
      status: 'progress'
    };
    
    setExports([newExport, ...exports]);
    
    // Simulate progress
    const interval = setInterval(() => {
      setExports(prevExports => {
        const updated = prevExports.map(exp => {
          if (exp.id === newExport.id && exp.progress < 100) {
            return { ...exp, progress: exp.progress + 10 };
          } else if (exp.id === newExport.id && exp.progress >= 100) {
            return { ...exp, status: 'complete' };
          }
          return exp;
        });
        return updated;
      });
    }, 300);
    
    setTimeout(() => clearInterval(interval), 3000);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-lime-50 to-lime-100 p-8">
      <div className="max-w-2xl mx-auto">
        {/* Header */}
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-2">Download Your Data</h1>
          <p className="text-gray-600">Select the data range and format for your export.</p>
        </div>

        {/* Main Card */}
        <div className="bg-white rounded-2xl shadow-lg p-8">
          {/* Date Range Selector */}
          <div className="mb-6">
            <label className="block text-sm font-semibold text-gray-900 mb-3">
              Date Range
            </label>
            <div className="relative">
              <Calendar className="absolute left-4 top-1/2 transform -translate-y-1/2 text-gray-400" size={20} />
              <select
                value={dateRange}
                onChange={(e) => setDateRange(e.target.value)}
                className="w-full pl-12 pr-4 py-3 bg-white border border-gray-200 rounded-lg appearance-none cursor-pointer focus:outline-none focus:ring-2 focus:ring-emerald-500 focus:border-transparent"
              >
                <option value="last7days">Last 7 days</option>
                <option value="last30days">Last 30 days</option>
                <option value="last90days">Last 90 days</option>
                <option value="custom">Custom Range</option>
              </select>
              <div className="absolute right-4 top-1/2 transform -translate-y-1/2 pointer-events-none">
                <svg className="w-5 h-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                </svg>
              </div>
            </div>
          </div>

          {/* File Format */}
          <div className="mb-6">
            <label className="block text-sm font-semibold text-gray-900 mb-3">
              File Format
            </label>
            <div className="grid grid-cols-2 gap-4">
              <button
                onClick={() => setFileFormat('csv')}
                className={`flex items-center justify-center gap-3 p-4 rounded-lg border-2 transition-all ${
                  fileFormat === 'csv'
                    ? 'bg-emerald-50 border-emerald-500'
                    : 'bg-white border-gray-200 hover:border-gray-300'
                }`}
              >
                <div className={`w-5 h-5 rounded-full border-2 flex items-center justify-center ${
                  fileFormat === 'csv'
                    ? 'border-emerald-500'
                    : 'border-gray-300'
                }`}>
                  {fileFormat === 'csv' && (
                    <div className="w-3 h-3 rounded-full bg-emerald-500"></div>
                  )}
                </div>
                <span className="font-medium text-gray-900">CSV</span>
              </button>

              <button
                onClick={() => setFileFormat('pdf')}
                className={`flex items-center justify-center gap-3 p-4 rounded-lg border-2 transition-all ${
                  fileFormat === 'pdf'
                    ? 'bg-emerald-50 border-emerald-500'
                    : 'bg-white border-gray-200 hover:border-gray-300'
                }`}
              >
                <div className={`w-5 h-5 rounded-full border-2 flex items-center justify-center ${
                  fileFormat === 'pdf'
                    ? 'border-emerald-500'
                    : 'border-gray-300'
                }`}>
                  {fileFormat === 'pdf' && (
                    <div className="w-3 h-3 rounded-full bg-emerald-500"></div>
                  )}
                </div>
                <span className="font-medium text-gray-900">PDF</span>
              </button>
            </div>
          </div>

          {/* Export Buttons */}
          <div className="grid grid-cols-2 gap-4 mb-8">
            <button
              onClick={() => handleExport('csv')}
              className="flex items-center justify-center gap-2 bg-emerald-500 hover:bg-emerald-600 text-white font-semibold py-4 rounded-lg transition-colors"
            >
              <FileText size={20} />
              Export CSV
            </button>
            <button
              onClick={() => handleExport('pdf')}
              className="flex items-center justify-center gap-2 bg-emerald-500 hover:bg-emerald-600 text-white font-semibold py-4 rounded-lg transition-colors"
            >
              <Download size={20} />
              Download PDF
            </button>
          </div>

          {/* Export Progress */}
          {/* <div>
            <h3 className="text-sm font-semibold text-gray-900 mb-4">Export Progress</h3>
            <div className="space-y-4">
              {exports.map((exp) => (
                <div key={exp.id} className="space-y-2">
                  <div className="flex items-center justify-between">
                    <span className="text-sm text-gray-700 font-medium">{exp.name}</span>
                    {exp.status === 'complete' ? (
                      <div className="flex items-center gap-2 text-emerald-500">
                        <CheckCircle size={18} />
                        <span className="text-sm font-medium">Complete</span>
                      </div>
                    ) : (
                      <div className="flex items-center gap-2 text-gray-500">
                        <Loader size={18} className="animate-spin" />
                        <span className="text-sm font-medium">In Progress...</span>
                      </div>
                    )}
                  </div>
                  <div className="w-full bg-gray-200 rounded-full h-2 overflow-hidden">
                    <div
                      className={`h-full rounded-full transition-all duration-300 ${
                        exp.status === 'complete' ? 'bg-emerald-500' : 'bg-emerald-400'
                      }`}
                      style={{ width: `${exp.progress}%` }}
                    ></div>
                  </div>
                </div>
              ))}
            </div>
          </div> */}
        </div>
      </div>
    </div>
  );
};

export default Export;
